import React, { Fragment, useEffect, useState } from 'react';
import HeroList from '../HeroList';
import ComicList from '../ComicList';

const Home = ({ toggleLoading }) => (
  <Fragment>
    <HeroList {...{ toggleLoading }} />
    <ComicList {...{ toggleLoading }} />
  </Fragment>
);

export default Home;
